  false,\n\t\"url\": null,\n\t\"notes\": \"The California Habitat Restoration Project
  Database (CHRPD) was created in 1999 to capture and maintain data about habitat
  restoration projects in California benefiting anadromous fish. The CHRPD is managed
  and supported by the California Department of Fish and Wildlife (CDFW), and funded
  by NOAA Fisheries and CDFW. Project locations are digitized in as much detail as
  possible based on the contractors' maps. The data set includes completed projects
  that were funded through the Fisheres Restoration Grant Program and also includes
  implementation and non-implementation projects completed from 1981 to May 2016.
  Many of the projects have multiple sites.\",\n\t\"owner_org\": \"467d900f-8a42-452d-9906-6610dd1a767f\",\n\t\"extras\":
